(6792, '17402', 'PA', 'Met-Ed - FirstEnergy', 'METED', 'Astral Energy LLC', 'unlimited', 0, 0, 0, 25, 6, '0', 'Limited time offer!! Get one month free when you sign up for the Astral\'s Ultimate Power Plan (UPP). Astral Energy’s Ultimate Power Plan (UPP) provides you with a unique, all-inclusive, customized, flat monthly price for electricity supply, no matter how much electricity you use.   UPP price offerings start as low as $19.99/month, but every customer is quoted a unique price to best meet their energy needs, based on their energy usage history and other factors.  The $19.99/month estimate above may not be indicative of your actual price quote.  The UPP has a 6-month term with no money up front.  Your UPP electricity supply charge will appear on your utility bill along with the utility’s charges for delivering your electricity.  For more information and to request a customized price quote, please submit your information by clicking on sign up for this offer and provide us with a copy of your bill.  You will receive a customized quote within 2 to 3 business days, which you may choose to accept or reject.', '888-850-1872', 'https://form.jotform.com/astralenergy/pap2s_first_free', 'June 03, 2020', 'PAPowerswitch', 'https://papowerswitch.com/', '2020-06-12 14:22:36.000000', 0.05361, 0.05361, 'This is the actual price from June 01, 2020 to August 30, 2020', NULL, NULL, 'https://www.papowerswitch.com/umbraco/Api/ShopApi/Rates?id=27494&servicetype=residential&ratetype=RS+-+Regular+Residential+Service', 'app_padata', '2020-06-12 14:22:36.000000', 'pa_spd', '2020-06-12 14:22:36.000000', 'pa_spd', NULL, NULL, NULL, NULL, NULL, NULL),
